import React from "react";
import logo from "../assets/Logo.png";
import logout from "../assets/logout.png";
import ButtonSecondary from "../components/ui/ButtonSecondary";
import { useNavigate } from "react-router-dom";
import { useDineEaseContext } from "../context/DineEaseContext";

/**
 * Layout that wraps the logged in parts of the page.
 */
const MainLayout = () => {
  const navigate = useNavigate();
  const { setToken } = useDineEaseContext();

  return (
    <div className="flex flex-col gap-4 overflow-x-hidden min-h-screen">
      <nav className="w-full px-6 py-2 flex gap-3 relative">
        <div className="w-32 h-32 rounded-full blur-2xl bg-primary-light z-[-1] absolute -top-1/2 right-0" />

        <img src={logo} alt="Logo" className="mr-auto" />

        <ButtonSecondary
          fullWidth={false}
          className="shadow-md"
          onClick={() => {
            setToken(null);
            navigate("/login");
          }}
        >
          <img src={logout} alt="Logout Icon" />
          Log Out
        </ButtonSecondary>
      </nav>

      <footer className="w-full mt-auto bg-black text-center p-4 text-white">
        &copy; 2023 - All rights reserved
      </footer>
    </div>
  );
};

export default MainLayout;
